import { StyleSheet } from "react-native";

import {colors} from '../../../styles/colors';

export const styles = StyleSheet.create({
    content: {
        borderWidth: 1,
        borderColor: colors.white,
        borderRadius: 60,
        padding: 10,
        color: colors.white,
        textDecorationColor:{
            color: colors.white,
        }
    }
});
